		return FALSE;

	HANDLE hRemoteThread = CreateRemoteThread(hProcess, nullptr, 0, (PTHREAD_START)lpLoadLibAddr, lpRemoteBuf, 0, nullptr);
	if (hRemoteThread == nullptr)
		return FALSE;

	WaitForSingleObject(hRemoteThread, INFINITE);

	VirtualFreeEx(hProcess, lpRemoteBuf, strlen(szDLLName) + 1, MEM_DECOMMIT);
	CloseHandle(hRemoteThread);
